import React from 'react';
import PropTypes from 'prop-types';
import { Link } from 'react-router-dom';

import './Publicate.css';

const Publicate = () => (
  <React.Fragment>
      <div className="main">
      <input type="text" className="post-input" placeholder="Название сбора"/>
        
      </div>
  </React.Fragment>
);

export default Publicate;
